List<ReconciliationDetail> reconciliationDetailsByTimeGroup = new ArrayList<>();
        reconciliationDetails.stream().collect(Collectors.groupingBy(reconciliationDetail -> reconciliationDetail.getBillTime() + reconciliationDetail.getPlatformStoreNo())).
                forEach((billTime,reconciliationDetailList) -> {
                    reconciliationDetailList.stream().reduce((r1,r2) -> {
                        r1.setAmount(r1.getAmount().add(r2.getAmount()));
                        return r1;
                    }).ifPresent(reconciliationDetailsByTimeGroup::add);
                });
        boolean error = reconciliationDetailsByTimeGroup.stream().anyMatch(r -> new BigDecimal(0).compareTo(r.getAmount()) >= 0);
        if (error) {
            throw new RuntimeException("解析失败：存在日金额汇总小于等于0的订单！");
        }

